                      alignItems: 'center',
                      justifyContent: 'center',
                      fontFamily: 'Rubik',
                      fontStyle: 'normal',
                      fontWeight: 500,
                      fontSize: 14,
                      color: '#979797',
                    }}
                  >
                    <Grid
                      item
                      style={{
                        flex: 1,
                        textAlign: 'center',
                        marginLeft: crmUploaded ? 30 : 0,
                      }}
                    >
                      <img
                        src={SalesAnalytics}
                        style={{
                          cursor: 'pointer',
